      acc: 'true'
    }
  }


  componentDidMount(){
     const data = getData();
     this.setState(acc = false)
    }

  render(){


    return (
    <div className="App">
        <Carddata data={data} type={true} header="Global Numbers" />
        <Carddata data={getData} type={false} header="Global Daily Increase" />
    </div>
  );}
}

